pragma solidity ^0.8.13;

interface ERC20 {
    function balanceOf(address account) external view returns (uint256);

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);
}

interface DailyTelosCalendar {
    function createEvent(
        string memory title,
        uint256 startTime,
        uint256 endTime,
        string memory metadataURI,
        address[] memory invitees
    ) external;
}

contract BunyERC6551Account is IERC165, IERC1271, IERC6551Account {
    uint256 private _nonce;
    string public accountName = "Daily Telos Token Owned Account";
    uint256 public depositCount = 0;
    mapping(uint256 => Deposit) public deposits;
    mapping(address => uint256) tokenBalances;
    mapping(address => PrivateCalendarEvent[]) public userPrivateEvents;
    mapping(address => CalendarEvent[]) public userEvents;
    address public calendarAddress;
    mapping(uint256 => address[]) public eventInvitations;
    address[] public users;
    address[] public eventCreators;
    uint256 public totalEvents;
    mapping(address => uint256) public eventCount;
    mapping(uint256 => NFTDeposit) public nftDeposits;
    uint256 public nftDepositCount = 0;

    event NewPrivateEventCreated(
        string title,
        address indexed attendee,
        uint256 startTime,
        uint256 endTime,
        uint256 timestamp
    );
    event NewDeposit(
        address indexed depositor,
        uint256 amount,
        uint256 timestamp
    );
    event NewERC20Deposit(
        address indexed depositor,
        address indexed tokenAddress,
        uint256 amount,
        uint256 timestamp
    );
    event WithdrawEvent(
        uint256 amount,
        address indexed recipient,
        uint256 timestamp
    );
    event NewNFTDeposit(
        address indexed depositor,
        address indexed nftContractAddress,
        uint256 tokenId,
        uint256 timestamp
    );



    event UserInvited(uint256 eventID, string title, address invitee);

    struct PrivateCalendarEvent {
        string title;
        address attendee;
        uint256 startTime;
        uint256 endTime;
    }

    struct NFTDeposit {
        address depositor;
        address nftContractAddress;
        uint256 tokenId;
        uint256 timestamp;
    }

    struct CalendarEvent {
        string title;
        address attendee;
        uint256 startTime;
        uint256 endTime;
        address calendar;
    }

    struct Deposit {
        address depositor;
        address tokenAddress;
        uint256 amount;
        uint256 timestamp;
    }

    receive() external payable {}

    function receiveNFT(address _nftContract, uint256 _tokenId) public {
        IERC721 nftToken = IERC721(_nftContract);
        require(
            msg.sender == nftToken.ownerOf(_tokenId),
            "Caller is not the owner of this NFT"
        );

        nftToken.transferFrom(msg.sender, address(this), _tokenId);

        nftDepositCount++;
        nftDeposits[nftDepositCount] = NFTDeposit({
            depositor: msg.sender,
            nftContractAddress: _nftContract,
            tokenId: _tokenId,
            timestamp: block.timestamp
        });

        emit NewNFTDeposit(msg.sender, _nftContract, _tokenId, block.timestamp);
    }

    // set custom name for account
    function setAccountName(string memory newName) public {
        require(
            msg.sender == owner(),
            "Only the contract owner can set the contract name"
        );
        accountName = newName;
    }

    // change default calendar contract address
    function setCalendarAddress(address _contractAddress) public {
        require(
            msg.sender == owner(),
            "Only owner can create calendar events "
        );
        calendarAddress = _contractAddress;
    }


    // public events saved on remote contract
    function getUserEvents(address user)
        public
        view
        returns (CalendarEvent[] memory)
    {
        return userEvents[user];
    }

    function createEvent(
        string memory title,
        uint256 startTime,
        uint256 endTime,
        string memory metadataURI,
        address[] memory invitees
    ) public {
        require(
            msg.sender == owner(),
            "Only NFT owner can create calendar events"
        );

        // Instantiate the DailyTelosCalendar interface
        DailyTelosCalendar calendar = DailyTelosCalendar(calendarAddress);

        // Call the function on the external contract
        calendar.createEvent(
            title,
            startTime,
            endTime,
            metadataURI,
            invitees
        );

        // Create a new event
        CalendarEvent memory newEvent;
        newEvent.title = title;
        newEvent.startTime = startTime;
        newEvent.endTime = endTime;
        newEvent.attendee = address(this);
        newEvent.calendar = calendarAddress;

        // Update local data
        userEvents[msg.sender].push(newEvent);
        uint256 eventID = userEvents[msg.sender].length - 1;
        totalEvents++;

        if (userEvents[msg.sender].length == 1) {
            users.push(msg.sender);
            eventCreators.push(msg.sender);
        }

        eventCount[msg.sender]++;

        for (uint256 i = 0; i < invitees.length; i++) {
            eventInvitations[eventID].push(invitees[i]);
            emit UserInvited(eventID, title, invitees[i]);
        }


    }

    // receive native chain erc20 tokens ie. TLOS
    function deposit() public payable {
        require(msg.value > 0, "Deposit amount must be greater than 0.");
        depositCount++;
        deposits[depositCount] = Deposit({
            depositor: msg.sender, // address of depositor
            tokenAddress: address(0), // native chain token. TLOS
            amount: msg.value, // amount to deposit
            timestamp: block.timestamp // timestamp of deposit
        });
        emit NewDeposit(msg.sender, msg.value, block.timestamp);
    }

    // function for depositing any erc20 token.
    function receiveERC20(address _erc20Token, uint256 amount) public payable {
        tokenBalances[_erc20Token] += amount;
        depositCount++;
        deposits[depositCount] = Deposit({
            depositor: msg.sender,
            tokenAddress: _erc20Token,
            amount: amount,
            timestamp: block.timestamp
        });
        emit NewERC20Deposit(
            msg.sender,
            _erc20Token,
            msg.value,
            block.timestamp
        );
    }

    // fetch contract tlos balance
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    // get specific erc20 balance
    function getTokenBalance(address _erc20Token)
        public
        view
        returns (uint256)
    {
        return ERC20(_erc20Token).balanceOf(address(this));
    }

    function executeCall(
        address to,
        uint256 value,
        bytes calldata data
    ) public payable returns (bytes memory result) {
        require(msg.sender == owner(), "Not token owner");
        bool success;
        (success, result) = to.call{value: value}(data);
        if (!success) {
            assembly {
                revert(add(result, 32), mload(result))
            }
        }
        _nonce += 1;
    }

    function withdraw(uint256 amount) public {
        require(msg.sender == owner(), "Only the owner can withdraw funds.");
        require(amount <= address(this).balance, "Insufficient balance.");
        payable(msg.sender).transfer(amount);
        emit WithdrawEvent(amount, msg.sender, block.timestamp);
    }

    function withdrawTo(address payable recipient, uint256 amount) public {
        require(msg.sender == owner(), "Only the owner can withdraw funds.");
        require(amount <= address(this).balance, "Insufficient balance.");
        recipient.transfer(amount);
    }

    function token()
        external
        view
        returns (
            uint256 chainId,
            address tokenContract,
            uint256 tokenId
        )
    {
        uint256 length = address(this).code.length;
        return
            abi.decode(
                Bytecode.codeAt(address(this), length - 0x60, length),
                (uint256, address, uint256)
            );
    }

    function owner() public view returns (address) {
        (uint256 chainId, address tokenContract, uint256 tokenId) = this
            .token();
        if (chainId != block.chainid) return address(0);

        return IERC721(tokenContract).ownerOf(tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public pure returns (bool) {
        return (interfaceId == type(IERC165).interfaceId ||
            interfaceId == type(IERC6551Account).interfaceId ||
            interfaceId == type(IERC1271).interfaceId);
    }

    function isValidSignature(bytes32 hash, bytes memory signature)
        external
        view
        returns (bytes4 magicValue)
    {
        bool isValid = SignatureChecker.isValidSignatureNow(
            owner(),
            hash,
            signature
        );

        if (isValid) {
            return IERC1271.isValidSignature.selector;
        }

        return bytes4(0xffffffff);
    }

    function nonce() external view override returns (uint256) {
        return _nonce;
    }
}
